import React, {useState} from 'react'
import Sidebar from '../../Components/Sidebar/Sidebar';
import './Profile.css'

const Profile = ({Dashboard, Chat}) => {
    const [ tab, setTab ] = useState(Dashboard)
    return (
        <>
            <Sidebar />
            <div className="home-section">
                <div>{tab}</div>
                Hello
            </div>
        </>
    )
}

export default Profile;
